\f0\fs64 \cf2 \expnd0\expndtw0\kerning0
Part of an art and technology collaboration exploring written text through diverse media, including printed text and sound, starting from a historical diary that has been typeset using the Monotype System. Here we outline a prototype scanning device and software, created to capture electronic data from a Monotype Tape. This entails interfacing between historical mechanical technology and modern electronic digital systems, and information transfers between physical and virtual realms.}

